package com.jiniaohou.springbootdemo.demos;

import cn.hutool.http.HttpUtil;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.*;

import java.util.UUID;

@Controller
public class DemoController {

    @RequestMapping("/")
    public String def(){
        return "index";
    }

    @GetMapping("getSignKey")
    @ResponseBody
    public String getSignKey(){
        // 加密算法获取key
        return UUID.randomUUID().toString();
    }

    @GetMapping("getImg/{signKey}")
    @ResponseBody
    public String getImg(@PathVariable("signKey") String signKey){
        String body =  HttpUtil.createGet("http://localhost:1994/api/getData/"+signKey).execute().body();
        System.out.println(body);
        return body;
//        return "data:image/png;base64,";
    }

}
